                    rgba = {
                        r: parseInt(color[0].split('(')[1]),
                        g: parseInt(color[1]),
                        b: parseInt(color[2].split(')')[0])
                    };

                //setting opacity
                if(color[3] !== undefined) {
                    rgba['a'] = color[3].split(')')[0];
                }
                return rgba;
